import React from 'react';
import Form from 'react-bootstrap/Form';



const ImageUpload = React.forwardRef((ref) => (
        <Form.Group>
            <Form.Label>Image Upload</Form.Label>
            <Form.File></Form.File>
        </Form.Group>
));

export default ImageUpload;
